  - uid: '@azure/arm-streamanalytics.Outputs.update'
    name: 'update(Output, string, string, string, Models.OutputsUpdateOptionalParams)'
    children: []
    type: method
    langs:
      - typeScript
    summary: Atualiza uma saída existente em um trabalho de streaming existente. Isso pode ser usado para atualizar parcialmente (ie. atualizar as propriedades de um ou dois) uma saída sem afetar o restante a definição de trabalho ou de saída.
    syntax:
      content: 'function update(output: Output, resourceGroupName: string, jobName: string, outputName: string, options?: Models.OutputsUpdateOptionalParams)'
      parameters:
        - id: output
          type:
            - '@azure/arm-streamanalytics.Output'
          description: Um objeto de saída. As propriedades especificadas aqui substituirão as propriedades correspondentes na saída existente (ie. Essas propriedades serão atualizadas). Quaisquer propriedades que são definidas como nulo aqui significa que a propriedade correspondente na saída existente permanecem os mesmos e não é alterado como resultado dessa operação de PATCH.
        - id: resourceGroupName
          type:
            - string
          description: O nome do grupo de recursos que contém o recurso. Você pode obter esse valor por meio da API do Gerenciador de Recursos do Azure ou por meio do portal.
        - id: jobName
          type:
            - string
          description: O nome do trabalho de streaming.
        - id: outputName
          type:
            - string
          description: O nome da saída.
        - id: options
          type:
            - Models.OutputsUpdateOptionalParams
          description: ''
          optional: true
      return:
        type:
          - Promise<Models.OutputsUpdateResponse>
    package: '@azure/arm-streamanalytics'
